                <div>
                    <p class="mb-4 text-lance-black text-xl font-medium leading-[26px] tracking-[-0.2px]">
                        What are community codes?
                    </p>
                    <p class="text-lance-black-60 text-sm md:text-base leading-5 md:leading-6 mb-1 md:mb-8">
                        Our community codes system is a framework designed to promote trust and safety within our lending and borrowing community. These codes establish a set of guidelines and standards that all members agree to follow, ensuring ethical conduct and fostering a positive environment for all participants.
                    </p>
                </div>
                <button @click="kycCompleted ? fetchCommunityCodes() : showKycIncompleteModal = true" class="btn btn-primary w-[282px]" :class="{'loading' : fetchingCommunityCodes}" :disabled="fetchingCommunityCodes">
                    <span v-show="!fetchingCommunityCodes">Invite Someone</span>
                    <Loader-Basic v-show="fetchingCommunityCodes" bg="#FFF" fg="#C3E48E" />
                </button>
            </div>
            <div v-show="showCommunityCodes" class="p-6 text-sm leading-6 w-max md:w-auto">
                <ul class="flex items-center text-lance-black-60 gap-[50.33px] md:gap-0">
                    <li class="w-1/2 md:w-1/4">
                        Code
                    </li>
                    <li class="w-1/2 md:w-1/4">
                        Status
                    </li>
                    <li class="w-1/2 md:w-1/4">
                        Used By
                    </li>
                    <li class="w-1/2 md:w-1/4">
                        Date Used
                    </li>
                </ul>
                <ul @click="!code.used ? showCommunityCodeDetails(code) : ''" v-for="(code, key) in communityCodes" :key="key" class="flex items-center py-6 border-b border-solid border-lance-black-5 text-lance-black cursor-pointer gap-[50.33px] md:gap-0">
                    <li class="w-1/2 md:w-1/4">
                        {{ code.code }}
                    </li>
                    <li class="w-1/2 md:w-1/4">
                        <p
                            class="text-xs leading-6 w-[94px] rounded-[31px] text-center"
                            :class="!code.used ? 'text-lance-green bg-lance-green-10' : 'text-lance-black-50 bg-lance-black-10'"
                        >
                            {{ code.used ? 'Inactive' : 'Active'}}
                        </p>
                    </li>
                    <li class="w-1/2 md:w-1/4">
                        {{ code.usedBy }}
                    </li>
                    <li class="w-1/2 md:w-1/4">
                        {{ code.usedAt ? new Date(code.usedAt).toLocaleDateString('en-GB', { day:"numeric", month:"long", year:"numeric" }) : '' }}
                    </li>
                </ul>
            </div>
        </div>

        <CommunityCodeDetailsModal v-show="showCommunityCodeDetailsModal" :code="selectedCode" @@close-community-code-details-modal="showCommunityCodeDetailsModal = false"/>

        <KYC-IncompleteKycNotificationModal v-if="!kycCompleted" v-show="showKycIncompleteModal" @@proceed-to-kyc-process="navigateTo('/dashboard?start_kyc=true')" @@close-kyc-incomplete-modal="showKycIncompleteModal = false;" />
    </div>
</template>

<script setup lang="ts">

    definePageMeta({
        middleware: 'auth',
        layout: 'dashboard'
    });

    const { kycCompleted } = storeToRefs(useKYCStore());

    const { communityCodes, showCommunityCodes } = storeToRefs(useCommunityCodesStore());
        
    const showKycIncompleteModal: Ref<boolean> = ref(false);

    const fetchingCommunityCodes: Ref<boolean> = ref(false);

    const { apiFetch } = useApiFetch();

    async function fetchCommunityCodes(){

        fetchingCommunityCodes.value = true;

        const result = await apiFetch('profile/community-codes');

        if((result as any).success && !(result as any).error){
            communityCodes.value = (result as any).data;
            showCommunityCodes.value = true;
            fetchingCommunityCodes.value = false;
        } else {
            fetchingCommunityCodes.value = false;
            // console.log((result as any).error);
        }
    }
    const selectedCode: Ref<CommunityCode | null> = ref(null);

    const showCommunityCodeDetailsModal: Ref<boolean> = ref(false);

    function showCommunityCodeDetails(code: CommunityCode | any){
        showCommunityCodeDetailsModal.value = true;
        selectedCode.value = code;
    }

</script>